import Link from 'next/link'
import {Tile} from "./OperatorTileStyled";


const OperatorTile = ({ ...props }) => {


    return(
        <Link as={`/pay/${props.operatorName}`} href={`/pay/[payOperatorID]`}>
            <Tile>
                <h2>{props.operatorName}</h2>
                <img src="" alt="Лого оператора"/>
            </Tile>
        </Link>
    )
}

export default OperatorTile
